import React, { useState } from 'react';
import CreateNote from './CreateNote';
import './GoogleKeep.css';
import Header from './Header';

const GoogleKeep=() =>{
  const [noteItem, setNoteItem]= useState([])

  const addNote=(note)=>{
    setNoteItem((preData)=>{
      [...preData,note]
    })
  }

  return (
    <>
      <Header/>
      <CreateNote passNote={addNote} />
    </>
  );
}

export default GoogleKeep;
